import React, { useState, useEffect } from 'react';
import Navbar2 from '../components/Navbar2';
import RecomendationCard from '../components/RecomendationCard';
import FoodCards from '../components/FoodCards';
import Eggs from '../imgs/eggs.jpeg';
import Footer2 from '../components/Footer2';

function HomePage() {
    const count = 700;
    const search = "food";
    const ing = "blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah ...";
    const steps = "blah blah blah blah blah blah blah blah blah blah blah blah blah blah blah ...";

    const [recipes, setRecipeInfo] = useState({});

    let listCards = null;

    useEffect(() => {
        const fetchData = async () => {
            const result = await fetch('/api/recipes');
            const body = await result.json();
            console.log(body);
            setRecipeInfo(body);
            listCards = body.map((recipe) =>
                <FoodCards foodName={recipe.name} estimatedPrice={recipe.price} image={Eggs} ingredients={ing} steps={steps}/>
            );
        }
        fetchData();
    }, []);



    return (
        <div id="homepage">
            <Navbar2/>
            <div id="search-info">
                <h5>{count} found for "{search}"</h5>
                <p>See Also:</p>
            </div>
            <div id="extra-eating-options">
                <RecomendationCard recomendation="Dinner"/>
                <RecomendationCard recomendation="Lunch"/>
                <RecomendationCard recomendation="Breakfast"/>
                <RecomendationCard recomendation="Dessert"/>
                <RecomendationCard recomendation="Snacks"/>
                <RecomendationCard recomendation="Drinks"/>
            </div>
            <div id="food-cards-container">
                {listCards}
            </div>
            <Footer2/>
        </div>
    );
}

export default HomePage;
